import {MemberType} from "../../../../utils/types/types";
import email from '../../../../assets/icons/email.svg'

export const MemberInfo: React.FC<{ card_: MemberType }> = ({card_}) => {
    return (
        <>
            <div className={'w-auto my-auto h-fit grid'}>
                <h3>Контакты</h3>
                <div className={'w-36 h-auto p-3 flex bg-white'}>
                    <img src={email} className={'p-5 w-10 h-10 rounded-2xl bg-secondary'}/>
                    <input className={'outline-0 bg-white text-black font-montserratRegular '} placeholder={'email'}/>
                </div>
                <button
                    className={'w-full px-5 py-3 font-montserratRegular group-hover/memberItem:hidden bg-secondary rounded-2xl text-black'}>{card_.employee}</button>
            </div>
        </>
    );
};
